def pixel_centroids_dist_2(img, centroids):
	"""
	Finds the SQUARED Euclidean distance between each pixel and each centroid.
	Args:
		img: a NumPy array image of shape (height, width, 3)
		centroids: a NumPy array of shape (K, 2) containing the yx coordinates of each centroid.  K is the number of centroids.
	Returns:
		a NumPy array of shape (K, height, width) containing the distances.
		Indexing the returned result by [j] should be the distances from each pixel to centroid j
	"""
	# Your code goes here!  Compute the SQUARED Euclidean distance, no need to square root!
	# Squared distances to centroid1

	height, width, _ = img.shape
	# Using function created at the beggining. Returns shape (height, width, 2)
	pixel_coords = generate_coordinates(height, width)
	# To be able to broadcast
	pixel_coords = np.reshape(pixel_coords, (height, width, 1, 2))

	# To be able to broadcast. Shape will be (1, 1, K, 2)
	centroids = np.reshape(centroids, (1, 1, -1, 2))
	# New shape will be (height, width, K) since we sum along last axis
	distances = np.sum((pixel_coords - centroids) ** 2, axis=-1)

	# We want to reorder to (K, height, width)
	distances = np.transpose(distances, (2, 0, 1))

	return distances

