def recompute_centroids_2(img, text, cluster):
	"""
	Takes the mean location to recompute the centroids based on the current cluster membership.
	For each cluster, find all pixels corresponding to that cluster that are also text.
	Then, compute the mean x and y coordinates to determine the new centroid for that cluster.
	Args:
		img: a NumPy array image of shape (height, width, 3)
		text: a boolean NumPy array of shape (height, width), where True indicates text, and False indicates background
		cluster: a NumPy array of shape (height, width) containing only integers, where 0 indicates closest to centroid[0], 1 indicates closest to centroid[1], and so on.
	Returns:
		a NumPy array of shape (K, 2) containing the recomputed yx coordinates of each centroid.  K is the number of centroids.
	"""
	# Your code goes here!
	# Number of centroids
	K = np.max(cluster) + 1

	text = np.array(text)
	# Mask pixels that are text
	text_mask = text.astype(int)

	height, width = text.shape
	# Using function made at the beggining, shape is (height, width, 2)
	coords = generate_coordinates(height, width)
	# Shape is (height, width) as we take only the y component
	y_indices = coords[:, :, 0]
	# Shape is (height, width) as we take only the x component
	x_indices = coords[:, :, 1]

	# We only keep the y coordinates of text pixels
	y_text = y_indices[text_mask == 1]
	# We only keep the x coordinates of text pixels
	x_text = x_indices[text_mask == 1]
	# Get the texted pixels closest centroids
	cluster_text = cluster[text_mask == 1]

	# Sum of coordinates y, x associated to each cluster
	coord_sum = np.zeros((K, 2))
	np.add.at(coord_sum, cluster_text, np.column_stack((y_text, x_text)))

	# Numbers of pixels associated to each cluster
	count = np.zeros(K)
	np.add.at(count, cluster_text, 1)

	centroids = np.zeros((K, 2))
	# In case some cluster doesn't have text associated to it, not divide by zero when computing mean
	count[count == 0] = 1
	centroids = coord_sum / count[:, np.newaxis]

	return centroids

